import "./Navbar.css";

function Navbar(){
    return (
        <header>
        <nav id="navbar">
            <ul>
                <li><a href="#welcome-section">home</a></li>
                <li><a href="#projects">work</a></li>
                <li><a href="#contact">contact</a></li>
                <li><a href="">blog</a></li>
            </ul>
        </nav>
    </header>
    )
}

export default Navbar;
